import React from 'react';
import './FloatingCharacter.css';

const FloatingCharacter = () => {
  return (
    <div className="spider-container">
      <svg className="spider" viewBox="0 0 100 100">
        {/* Body */}
        <ellipse cx="50" cy="40" rx="12" ry="18" fill="#1a1a1a" />
        
        {/* Head */}
        <circle cx="50" cy="18" r="10" fill="#1a1a1a" />
        
        {/* Eyes */}
        <circle cx="45" cy="16" r="2.5" fill="#ff6b00" opacity="0.9" />
        <circle cx="55" cy="16" r="2.5" fill="#ff6b00" opacity="0.9" />
        
        {/* Front Left Leg 1 - moves first */}
        <g className="leg-group leg-1">
          <path className="leg-segment" d="M 40 32 Q 30 28 18 22 Q 15 21 12 20" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Front Left Leg 2 - moves with leg 1 */}
        <g className="leg-group leg-2">
          <path className="leg-segment" d="M 38 40 Q 25 38 12 35 Q 9 34 6 33" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Front Right Leg 1 - moves with front left */}
        <g className="leg-group leg-5">
          <path className="leg-segment" d="M 60 32 Q 70 28 82 22 Q 85 21 88 20" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Front Right Leg 2 - moves with front left */}
        <g className="leg-group leg-6">
          <path className="leg-segment" d="M 62 40 Q 75 38 88 35 Q 91 34 94 33" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Back Left Leg 1 - moves second */}
        <g className="leg-group leg-3">
          <path className="leg-segment" d="M 40 55 Q 28 65 15 75 Q 12 77 10 80" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Back Left Leg 2 - moves with back left */}
        <g className="leg-group leg-4">
          <path className="leg-segment" d="M 42 63 Q 28 72 18 85 Q 15 88 12 92" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Back Right Leg 1 - moves with back left */}
        <g className="leg-group leg-7">
          <path className="leg-segment" d="M 60 55 Q 72 65 85 75 Q 88 77 90 80" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Back Right Leg 2 - moves with back left */}
        <g className="leg-group leg-8">
          <path className="leg-segment" d="M 58 63 Q 72 72 82 85 Q 85 88 88 92" stroke="#1a1a1a" strokeWidth="2.5" fill="none" strokeLinecap="round" />
        </g>
      </svg>
    </div>
  );
};

export default FloatingCharacter;
